    <script>

      function removeThumbnails(uri){
        console.log('thumbnail/delete/' + uri);
        fetch('http://localhost:2020/thumbnail/delete/' + uri,  { method: 'GET'})
          .then( response => {
            return response.json();
          }).then(data =>  {
            alert( JSON.stringify(data, null, 2))
          }).catch(e => {
            console.log(e)
          })
      }
      
    </script>
